package com.yeon.mvc.main;

// M
public class CalcResult {
	private int hab;
	private int cha;
	private int gob;
	private int mok;

	public CalcResult() {
		// TODO Auto-generated constructor stub
	}

	public CalcResult(int hab, int cha, int gob, int mok) {
		super();
		this.hab = hab;
		this.cha = cha;
		this.gob = gob;
		this.mok = mok;
	}

	public int getHab() {
		return hab;
	}

	public void setHab(int hab) {
		this.hab = hab;
	}

	public int getCha() {
		return cha;
	}

	public void setCha(int cha) {
		this.cha = cha;
	}

	public int getGob() {
		return gob;
	}

	public void setGob(int gob) {
		this.gob = gob;
	}

	public int getMok() {
		return mok;
	}

	public void setMok(int mok) {
		this.mok = mok;
	}
	
	
	
	
	
}


